import React from "react";
import "../Css/Pesticides.css";
import Navbar from "../components/Navbar";
import Footer from "../components/Footer";

function Pesticides() {
	const pesticides = [
	  {
	    id: 1,
	    name: "Organic Neem Pesticide",
	    price: 320,
	    img: "https://images.unsplash.com/photo-1590502593747-42a996133562?auto=format&fit=crop&w=600&q=80"
	  },
	  {
	    id: 2,
	    name: "Fast Action Insect Spray",
	    price: 450,
	    img: "https://images.unsplash.com/photo-1598062548096-9f3612c3424f?auto=format&fit=crop&w=600&q=80"
	  },
	  {
	    id: 3,
	    name: "Bio Insect Killer",
	    price: 380,
	    img: "https://images.unsplash.com/photo-1465406325902-7c46273c7d0e?auto=format&fit=crop&w=600&q=80"
	  },
	  {
	    id: 4,
	    name: "Anti-Fungal Spray",
	    price: 290,
	    img: "https://images.unsplash.com/photo-1501004318641-b39e6451bec6?auto=format&fit=crop&w=600&q=80"
	  },
	  {
	    id: 5,
	    name: "Herbal Garden Protector",
	    price: 310,
	    img: "https://images.unsplash.com/photo-1515468381878-2a0f4e24eaa4?auto=format&fit=crop&w=600&q=80"
	  },
	  {
	    id: 6,
	    name: "Neem Oil Shield",
	    price: 360,
	    img: "https://th.bing.com/th/id/OIP.PGFsvaZ9fjb8XvmpUjUtqgHaHa?w=174&h=180&c=7&r=0&o=7&cb=ucfimg2&dpr=1.3&pid=1.7&rm=3&ucfimg=1"
	  },
	  {
	    id: 7,
	    name: "Crop Protector Plus",
	    price: 420,
	    img: "https://images.unsplash.com/photo-1618384887929-16ec33fab9ef?auto=format&fit=crop&w=600&q=80"
	  },
	  {
	    id: 8,
	    name: "Eco Insect Spray",
	    price: 275,
	    img: "https://images.unsplash.com/photo-1503602642458-232111445657?auto=format&fit=crop&w=600&q=80"
	  },
	  {
	    id: 9,
	    name: "Soil Pest Control",
	    price: 340,
	    img: "https://images.unsplash.com/photo-1558640476-437a2a134f62?auto=format&fit=crop&w=600&q=80"
	  },
	  {
	    id: 10,
	    name: "Leaf Miner Killer",
	    price: 390,
	    img: "https://images.unsplash.com/photo-1578496781321-2f6c1d09bd57?auto=format&fit=crop&w=600&q=80"
	  },
	  {
	    id: 11,
	    name: "Vegetable Guard Spray",
	    price: 330,
	    img: "https://images.unsplash.com/photo-1584267385494-9a4e0b2b7d95?auto=format&fit=crop&w=600&q=80"
	  },
	  {
	    id: 12,
	    name: "Flower Protection Spray",
	    price: 295,
	    img: "https://images.unsplash.com/photo-1602525423096-f18b2e4f25ad?auto=format&fit=crop&w=600&q=80"
	  },
	  {
	    id: 13,
	    name: "Termite Blocker",
	    price: 520,
	    img: "https://images.unsplash.com/photo-1517260739337-6799d3b5c5f9?auto=format&fit=crop&w=600&q=80"
	  },
	  {
	    id: 14,
	    name: "Ant & Roach Spray",
	    price: 410,
	    img: "https://images.unsplash.com/photo-1598413458571-8eab70000a8a?auto=format&fit=crop&w=600&q=80"
	  },
	  {
	    id: 15,
	    name: "Fruit Fly Trap Liquid",
	    price: 260,
	    img: "https://images.unsplash.com/photo-1618384887929-16ec33fab9ef?auto=format&fit=crop&w=600&q=80"
	  },
	  {
	    id: 16,
	    name: "Mite Control Spray",
	    price: 370,
	    img: "https://images.unsplash.com/photo-1590502593747-42a996133562?auto=format&fit=crop&w=600&q=80"
	  },
	  {
	    id: 17,
	    name: "Organic Crop Shield",
	    price: 450,
	    img: "https://images.unsplash.com/photo-1501004318641-b39e6451bec6?auto=format&fit=crop&w=600&q=80"
	  },
	  {
	    id: 18,
	    name: "Fungus Stop Plus",
	    price: 310,
	    img: "https://images.unsplash.com/photo-1598062548096-9f3612c3424f?auto=format&fit=crop&w=600&q=80"
	  },
	  {
	    id: 19,
	    name: "Multi-Insect Repellent",
	    price: 390,
	    img: "https://images.unsplash.com/photo-1465406325902-7c46273c7d0e?auto=format&fit=crop&w=600&q=80"
	  }
	];



  return (
    <>
      {/* ⭐ NAVBAR */}
      <Navbar />

      <div className="pesticide-container" style={{ marginTop: "80px" }}>
        <h2 className="pesticide-title">
          <i className="fa fa-vial"></i> Pesticides Store
        </h2>

        <div className="pesticide-grid">
          {pesticides.map((item) => (
            <div className="pesticide-card" key={item.id}>
              <img src={item.img} alt={item.name} className="pesticide-img" />

              <h3 className="pesticide-name">{item.name}</h3>

              <p className="pesticide-price">
                <i className="fa fa-rupee-sign"></i> {item.price}
              </p>

              <button className="pesticide-btn">
                <i className="fa fa-shopping-cart"></i> Buy Pesticide
              </button>
            </div>
          ))}
        </div>
      </div>

      {/* ⭐ FOOTER */}
      <Footer />
    </>
  );
}

export default Pesticides;
